import './App.css';
import Movies from './components/movies_front';
import { useState,useEffect} from 'react';


const FEA_API = "https://api.themoviedb.org/3/discover/movie?sort_by=popularity.desc&api_key=8867ee32e88d72e6d21ef084a3df3e44"
function App() {
  const [movies, setmovies] = useState([]);

  useEffect(() => {
   fetch(FEA_API)
   .then((res) => res.json())
   .then((data) => {
     console.log(data.results)
    setmovies(data.results)
   });


  }, [])


  return(

    <div>
      <header>
        <div className="row bg-dark p-5">
          <div className="col-md-8">
            <h1>Moviebuzz</h1>
          </div>
          <div className="col-md-3">
         <span className="fa fa-search"> </span><input className="form-control col-3" placeholder="Type movie name"/>
        </div>
        </div>
        </header>
     {movies.length >0 && movies.map((movies)=>(
        <Movies key={movies.id} {...movies}/>
     ))}

    </div>
  );
}

export default App;
